import React from 'react';
import '../App/App.css';
import Banner from '../Banner/Banner';



class Home extends React.Component {
    render(){
        const homeInfo = {
            title: 'Home',
            path: '/',
            cName: 'nav-text',
            imageSrc: require('../images/profile.png'),
            name: 'home'
        }
        return (
            <div className='home'>
               
                <Banner 
                imageSrc = {homeInfo.imageSrc}/>
            </div>
        )
    }
}

export default Home;
